import React from "react";
import data from "../../data/movie_crew";

const { cast } = data;

export const Cast = () => {
  return (
    <div className="">
      <h1 className="content-header">Cast</h1>
      <div>
        {cast.map((actor) => {
          const { id, name, character } = actor;
        })}
      </div>
    </div>
  );
};

export default Cast;
